import React,{Component} from 'react';
import logo from './logo.svg';
import './App.css';
import Chart from './components/Chart.js'

class App extends Component {
  constructor(){
    super();
    this.state = {
      chartData:{}
    }
  }

  componentWillMount(){
    this.getChartData();
  }

  getChartData(){
    //AJAX CALL HERE
    this.setState({
      chartData:{
        labels: ["1","2","3","4","5"],
        datasets:[
           {
               label: 'Population',
               data: [1,2,5,2,9,3,10,6,7,4],
               backgroundColor: "green"
           }
        ]
    }
    });
  }

  render(){
  return (
    <div className="App">

      <Chart chartData = {this.state.chartData} location="New York"/>
    </div>
  );
  }
}

export default App;
